import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Dashboard.css';

const Dashboard = () => {
  return (
    <div className="dashboard">
      <button className="start-project-btn">
        <Link to="/start-project">+ Start a project</Link>
      </button>
      <div className="project-section">
        <h3>Recent</h3>
        <div className="projects">
          <div className="project-card">
          <div className="project-header">Social Media Poster</div>
          </div>
          <div className="project-card">TMP 120 Project</div>
          <div className="project-card">Self-Study App-Dev</div>
        </div>
        <h3>Done</h3>
        <div className="projects">
          <div className="project-card">Event Plan</div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
